import { Container, Row, Col } from 'react-bootstrap';
import './Footer.css';

export default class Footer extends Component {
	render() {
		return (
			<React.Fragment>
				<div className="bg-position-footer">
					<Container>
						<Row>
							<Col>
								<h3 className="title-footer">prijavi se</h3>
							</Col>
							<Col>
								<h3 className="title-footer">prijavi se</h3>
							</Col>
							<Col>
								<h3 className="title-footer">Prijavi se</h3>
							</Col>
							<Col>
								<h3 className="title-footer">Prijavi se</h3>
							</Col>
						</Row>
					</Container>
				</div>
			</React.Fragment>
		);
	}
}
